import React from "react";
import Navbar from "../components/Navbar";
import FileUpload from "../components/FileUpload";

const Home = () => {
  return (
    <div>
      <Navbar />
      <h2 style={{ textAlign: "center", marginTop: "20px" }}>
        Upload a Legal Document for Analysis
      </h2>
      <FileUpload />
    </div>
  );
};

export default Home;
